{'api_name': 'AeroDataBox', 'api_description': 'Flight data API for travel, hospitality, or aviation applications, researchers, small teams, and individual developers.', 'api_method_name': '(BETA) Aircraft image recognition', 'api_method_description': "**What aircrafts are depicted on this photo?**

This endpoint recognizes aircrafts on uploaded image and returns information about all detected aircrafts. It is based on computer vision technology and therefore results may be imprecise. It relies on detecting aircrafts' registrations and, once detected, attempting to match these registration with records in aircrafts database.

Returns: Data about found and recognized aircrafts.", 'api_method_parameters': [{'name': 'photo', 'type': 'BINARY', 'description': 'Image containing aircraft. It should be image-type file (JPEG, PNG or BMP).  To improve results:  ensure that aircraft registration is as much as possible visible on the image; other inscriptions are visible as least as possible or absent on the image (although algorithm strives to filter these out as much as possible, false results are still possible).', 'default': '', 'required': False, 'constraints': {'format': 'JPEG, PNG, BMP'}}]}

