{'api_name': 'Recipe - Food - Nutrition', 'api_description': 'The spoonacular Nutrition, Recipe, and Food API allows you to access over 365,000 recipes and 86,000 food products. Our food ontology and semantic recipe search engine makes it possible to search for recipes using natural language queries, such as "gluten free brownies without sugar" or "low fat vegan cupcakes." You can automatically calculate the nutritional information for any recipe, analyze recipe costs, visualize ingredient lists, find recipes for what's in your fridge, find recipes based on special diets, nutritional requirements, or favorite ingredients, classify recipes into types and cuisines, convert ingredient amounts, or even compute an entire meal plan. With our powerful API, you can create many kinds of food and especially nutrition apps.

Special diets/dietary requirements currently available include: vegan, vegetarian, pescetarian, gluten free, grain free, dairy free, high protein, low sodium, low carb, Paleo, Primal, ketogenic, FODMAP, and Whole 30. We will soon be adding Weight Watcher points, too.', 'api_method_name': 'Recipe Nutrition Widget', 'api_method_description': "Visualize a recipe's nutritional information as HTML including CSS. 

Full example code of how to work with widgets can be found in our [spoonacular-widget GitHub](https://github.com/ddsky/spoonacular-widgets).", 'api_method_parameters': [{'name': 'servings', 'type': 'NUMBER', 'description': 'The number of servings.', 'default': '2', 'required': True, 'constraints': {'values': {'min': 1}}}, {'name': 'ingredientList', 'type': 'STRING', 'description': 'The ingredient list of the recipe, one ingredient per line.', 'default': '3 oz flour', 'required': True, 'constraints': {}}, {'name': 'showBacklink', 'type': 'BOOLEAN', 'description': 'Whether to show a backlink to spoonacular.', 'default': 'true', 'required': False, 'constraints': {}}, {'name': 'defaultCss', 'type': 'BOOLEAN', 'description': 'Whether the default CSS should be added to the response.', 'default': 'true', 'required': False, 'constraints': {}}, {'name': 'language', 'type': 'STRING', 'description': 'The input language, either "en" or "de".', 'default': 'en', 'required': False, 'constraints': {'values': {'enumerated': ['en', 'de']}}}]}

{'api_name': 'Recipe - Food - Nutrition', 'api_description': 'The spoonacular Nutrition, Recipe, and Food API allows you to access over 365,000 recipes and 86,000 food products. Our food ontology and semantic recipe search engine makes it possible to search for recipes using natural language queries, such as "gluten free brownies without sugar" or "low fat vegan cupcakes." You can automatically calculate the nutritional information for any recipe, analyze recipe costs, visualize ingredient lists, find recipes for what's in your fridge, find recipes based on special diets, nutritional requirements, or favorite ingredients, classify recipes into types and cuisines, convert ingredient amounts, or even compute an entire meal plan. With our powerful API, you can create many kinds of food and especially nutrition apps.

