{'api_name': 'Edamam Food and Grocery Database', 'api_description': 'This API provides you with tools to find nutrition and diet data for generic foods, packaged foods and restaurant meals. In addition it employs NLP (Natural Language Processing) which allows for extraction of food entities from unstructured text.   

Covered Use Cases: 
    -Search for a food by keyword, food name or UPC/Barcode 
    -Sourcing of nutrition facts for a given food, including: macro and micro nutrients, allergen labels, lifestyle and health labels 
    -Search for a food by give...', 'api_method_name': '/api/food-database/v2/parser', 'api_method_description': 'The parser access point handles text search for foods as well as filters for the foods like presence specific nutrient content or exclusion of allergens. <ul> <li>Search for a phrase or keyword using NLP to get food entities from it.</li> <li> Get basic nutrition facts and ingredients for each food </li> <li> Search for food by given nutrient quantity for 28 nutrients </li> <li> Search for foods within a given brand </li> <li> With the build in food-logging context it allows for requests which do not contain quantity and suggest expected quantities for them. </li> </ul>

 <b>Access Point:</b> https://api.edamam.com/api/food-database/v2/parser', 'api_method_parameters': [{'name': 'nutrients[WATER]', 'type': 'STRING', 'description': 'Water. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[K]', 'type': 'STRING', 'description': 'Potassium, K. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[SUGAR.added]', 'type': 'STRING', 'description': 'Sugars, added. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[FIBTG]', 'type': 'STRING', 'description': 'Fiber, total dietary. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[VITK1]', 'type': 'STRING', 'description': 'Vitamin K (phylloquinone). Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[THIA]', 'type': 'STRING', 'description': 'Thiamin. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[FOLAC]', 'type': 'STRING', 'description': 'Folic acid. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[SUGAR]', 'type': 'STRING', 'description': 'Sugars, total. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[VITC]', 'type': 'STRING', 'description': 'Vitamin C, total ascorbic acid. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[RIBF]', 'type': 'STRING', 'description': 'Riboflavin. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[CHOCDF.net]', 'type': 'STRING', 'description': 'Carbohydrates (net). Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[CHOCDF]', 'type': 'STRING', 'description': 'Carbohydrate, by difference. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[VITD]', 'type': 'STRING', 'description': 'Vitamin D (D2 + D3). Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <b