nput the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[NA]', 'type': 'STRING', 'description': 'Sodium, Na. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[P]', 'type': 'STRING', 'description': 'Phosphorus, P. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[FAPU]', 'type': 'STRING', 'description': 'Fatty acids, total polyunsaturated. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[CA]', 'type': 'STRING', 'description': 'Calcium, Ca. Unit: mg. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> For example: nutrients[CA]=50+ means minimum 50mg calcium, where 50+ has to be properly encoded as 50%2B nutrients[FAT]=30 means maximum 30g fat and nutrients[FE]=5-10 means iron between 5mg and 10mg inclusive', 'default': '', 'required': False}, {'name': 'nutrients[VITB12]', 'type': 'STRING', 'description': 'Vitamin B12. Unit: g. Input the range which is one of MIN+, MIN-MAX or MAX, where MIN and MAX are non-negative floating point numbers. <br> <br> See calcium for an example for how to fill in the range.', 'default': '', 'required': False}, {'name': 'nutrients[ZN]', 'type': 'STRING', 'description': 'Zinc, Zn. Unit: mg. Input the range which is